import React from 'react';
import Button from './buttons';
import pageButtons from '../data/headerButtons';

function Header() {
  const headerButtons = pageButtons;

  return (
    <nav>
      { headerButtons.map(btn => <Button buttonName={btn} />) }
    </nav>
  );
}

export default Header;
